column24:
&nbsp;
모든 객실에서 대형 제트 스파를 즐길 수 있고 멋진 바다 조망이 가능하다.







??

??






산방산-용머리해안 지질트레일 코스에 위치한 지오하우스로&nbsp;
사계해안도로와 5분거리에 위치해있다.&nbsp;
산방산, 용머리해안 지역의 화산활동으로 빚어진 자연을 보고, 즐길 수 있도록 글램핑 텐트시설이 조성되었다.







?

??


기준인원 초과요금: 3세 이상부터 10,000원&nbsp; 이불추가요금: 10,000원&nbsp;
 바비큐 이용요금: 무료(숯,석쇠(중간사이즈),구이용음식 등은 개별 준비 요망)&nbsp;
 픽업서비스 제공(4인 이하)&nbsp; 에이지 감귤 농장에서 감귤 수확 체험 가능 
&nbsp;주변관광지로는 섭지코지, 성읍민속마을, 트릭아트뮤지엄 등이 있습니다.





?

?비즈니스 여행과 레저 여행 모두에 적합한&nbsp;제주 시내에 위치해 있다.&nbsp;
시내에 위치해 있어 각종 편의시설을 이용하기 좋으며, 공항에서 2.2 km 거리에 있어&nbsp;이동이 편리하다.
6층 건물의 깨끗하고 현대적인 분위기의 호텔로, 고급스러운 브라운톤의 인테리어로 디자인되어 있다.??

제주서부(애월)에 위치해 있는 초록새록펜션(구, 통나무아일랜드)는&nbsp;
???????애월해안도로에서 5분거리에 위치해있으며
가족과 연인과 자연속에 힐링을 할 수 있고 아름다운 추억을 만들 수 있는 곳이다.


&nbsp;






??

호텔 샬롬제주는 호텔 이용객들의 휴식과 비즈니스를 돕는 다양한 최상의 서비스와 차별화된 편의시설을 제공합니다.

에메랄드빛 제주도 바다와 한라산이 조망되는 17층 최대 200명 수용하능한 컨벤션 센터,
고객라이프스타일을 고려한 공간배치와 인테리어를 구현한 176개의 객실로 구성되어 있습니다.

또한 전문적이고 효율적인 서비스를 갖춘 비즈니스코너와 미팅룸과
심심을 재충전할 수 있는 피트니스 센터가 준비되어 있습니다.




?&lt;디럭스 트윈룸&gt;
더블베드와 싱글베드가 있는 모던한 객실로 고급침구와 침대로 한단계 업그레이드 된 휴식을 제공합니다.

&lt;디럭스 더블룸&gt;
모던한 아름다움과 고급침구 및 침대 그리고 고급 어메니티로 한단계 업그레이드 된 휴식을 제공합니다.

&lt;더블 트리플 싱글룸&gt;
싱글베드 3개로 구성된 트리플 베드타입 객실로 넓은 객실과 고급 침구로 한단계 업그레이드 된 휴식을 제공합니다.

&lt;디럭스 온돌룸&gt;
감각적이고 시각적인 분위기를 자아내는 모던한 디자인으로 고객의 라이프스타일을 고려한 공간배치와 인테리어를 구현하였습니다.

&lt;스위트룸&gt;
편안함과 간결함이 돋보이는 고급친구와 편안한 침대 및 고급 어메니티로 고객의 가치를 한층 더 높여드립니다.



?

마라도의 바다를 정원으로 삼아 하룻밤 쉬어간다면 선택할 수 있는 마라도 게스트하우스.&nbsp;

각 객실 이름이 물고기 이름으로 되어있어 재미있다.&nbsp;

게스트하우스 입구에 카페로간 물고기 카페가 있어 차한잔 함께 하기 좋다.&nbsp;

대부분 관광객들이 잠시 머물다 가는데

하룻밤 쉬었다가는 여유를 찾을 수 있는 곳이다.&nbsp;

???????

?


?


?


?

?
배목수가 직접 올린 당근 밭 돌담 사이 배목수집

&nbsp;배목수집은 당근 밭 너머 돌담 사이로 큰 나무가 서 있는 마당 넓은 곳이다.&nbsp;
세화 바다 가까이에 있고 건물 앞으로 다랑쉬 오름이 자리 잡고 있다.&nbsp;

이름처럼 1년여의 시간동안 배목수가 직접 지은 두 집이다.

&nbsp;첫 번째 집 왼편과 다락방은 배목수 가족이 머무는 곳이고 오른편이 여행객들이 머무는 공간이다.&nbsp;
독채로 분리되어 있지는 않지만, 뒤뜰과 툇마루에서 여유로운 시간을 즐길 수 있다.

?????????
?
두 번째 집은 큰 나무 아래에 자그마한 정원이 함께 있는 삼나무로 지어진 집이다.&nbsp;
앞에 서 있는 큰 나무는 제주 토종 나무인 먹구슬낭인데 여름에는 예쁜 보라색 꽃이 피고 가을에는 동그랗고 노란 열매가 열려 보는 즐거움을 더해준다.&nbsp;
???????
삼나무 원목을 그대로 사용해서 화학 성분이 전혀 없는 두 번째 집은 자연친화적이다.&nbsp;
&nbsp;객실 내부 한 쪽에는 다양한 서적이 구비되어 있는데, 아이들과 함께 여행하는 가족들을 위하여 아동 서적도 세심하게 갖춰져 있다.

????????

기준인원 초과요금: 1인(8세 이상) 20,000원 / 소아(4세~7세) 10,000원&nbsp;
 유아(36개월 미만) 무료 바베큐 이용요금: 20,000원(18:00 ~ 22:00)







